import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header"> 
        <form action="localhost:5000/lookup" method="GET">
          <label>
            WHOIS IP or Domain Lookup: <br/>
            <input type="text" name="domain" placeholder="e.g. www.google.com..."/>
          </label>
          <button type="submit">Search</button>
        </form>
      </header>
    </div>
  );
}

export default App;
